CREATE DEFINER=`root`@`localhost` PROCEDURE `QueryProcessor`(IN `word` VARCHAR(500))
BEGIN
	SET @sql = CONCAT('select keyword, doc, title, url, count(*) AS WordCount, sum(least(TF, 100) * IDF) * 0.6 + 0.4 * rank AS weight from urls, keywords, 	searchindex where urls.url_id = searchindex.uid and keywords.keywordid = searchindex.kwid and keywords.keyword in (', word, ') group by url_id order by weight desc');
  	PREPARE stmt FROM @sql;
  	EXECUTE stmt;
  	DEALLOCATE PREPARE stmt;
END ;;
